<html><head>
		<meta http-equiv="Content-Type" content="text/html; charset=utf-8">
		<meta name="uuid" content="70c3556b-1366-4b96-b980-99e6cb337cfd">
		<meta itemprop="text_direction" content="horizontal-lr">
		<style>
			body {
	background: #f3f3f3;
	
	
	
}

[contenteditable=true]:empty:before {
	content: attr(data-placeholder);
	display: block; /* For Firefox */
}

li[contenteditable=true]:hover, li[contenteditable=true].hovered, span[contenteditable=true]:hover, span[contenteditable=true].hovered {
	border: 1px solid #ff0000;
}

.rect:hover, a.hovered {
	box-shadow: inset 0 0 0 1px #ff0000;
}

li[contenteditable=true]{
	border: 1px dashed #000;
	width: 100%;
	padding: 2px;
	margin: 0 0 5px 0;
}

ul {
	list-style-type:none;
}

nav {
	background: #444;
	position: fixed;
	top: 0;
	left: 0;
	height: 100%;
	width: 10%;
	font-family: "Helvetica Neue", Arial, sans-serif;
}

nav ul {
	list-style: none;
	margin-right: 1em;
}

nav li {
	display : inline-block;
}

nav a {
	color: white;
	text-decoration: none;
}

nav a:hover {
	text-decoration: underline;	
}

.container {
	position: relative;
	margin-left: 15%;
	display: table;
	height: 100%;
	width: 85%;
}

.img_container {
	position: relative;
}

.column {
	display: table-cell;
	vertical-align: top;
	width: 50%;
	height: 100%;
	padding: 1rem;
}

#download_button {
	position: fixed;
	padding: 0;
	text-align: center;
	width: 10%;
	bottom: 50px;
}

.corrected {
	background-color: #73AD21;
}

		<script>
			$(document).ready(function() {
				var uuid = $('meta[name=uuid]').attr('content');
				if (localStorage) {
					$('li[contenteditable=true], span').each(function(index) {
						if(localStorage[uuid + this.id]) {
							$(this).text(localStorage[uuid + this.id]);
						}
					});
				}
				// focus text fields when lines/words are clicked + mouseover
				$('a.rect').click(function(e) {
					e.preventDefault();
					$('#' + $(this).attr('alt')).focus();
				}).mouseover(function(e) {
					$('#' + $(this).attr('alt')).addClass("hovered");
				}).mouseout(function(e) {
					$('#' + $(this).attr('alt')).removeClass("hovered");
				});

				// create mouseover effect on text fields
				$('li[contenteditable=true], span').mouseover(function(e) {
					console.log(this.id);
					$('a.rect[alt=' + this.id + ']').addClass("hovered");
				}).mouseout(function(e) {
					$('a.rect[alt=' + this.id + ']').removeClass("hovered");
				}).focusin(function(e) {
					$('a.rect[alt=' + this.id + ']').addClass("hovered");
				}).focusout(function(e) {
					$('a.rect[alt=' + this.id + ']').removeClass("hovered");
				}).keydown(function(e) {
					if(e.which == 13) {
						e.preventDefault();
						$(this).addClass('corrected');
						var $els = $('[contenteditable=true]');
						$els.eq($els.index(this) + 1).focus();
					}
				// save to local storage 
				}).keyup(function () {
					localStorage[uuid + this.id] = $(this).text();
				});
				
				// smooth scrolling
				$('.page_anchor').click(function(e) {
					e.preventDefault();
					var target = $(this).attr("href");
					var top = $(target).offset().top;
					$('html, body').stop().animate({scrollTop: top }, 500);
				});

				// serializing the DOM to a file
				$('#download_button').click(function(e) {
					path = window.location.pathname;
					$(this).attr('href', 'data:text/html,' + encodeURIComponent($('html')[0].outerHTML));
					$(this).attr('download', path.substr(path.lastIndexOf('/') + 1));
				});
			});
		</script>
